import React from 'react';
import Navbar from './Navbar';
import Content from './Content';
import Videopage from "./Videopage";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

export default function Page2() {
    const articles = [
        {
          "img" : "https://talksport.com/wp-content/uploads/sites/5/2023/06/LB-tsport-freddie-copy.jpg?strip=all&quality=100&w=1500&h=1000&crop=1",
          "url" : "/videos/vid1.mp4"
        },
        {
          "img" : "https://talksport.com/wp-content/uploads/sites/5/2023/06/LB-tsport-freddie-copy.jpg?strip=all&quality=100&w=1500&h=1000&crop=1",
          "url" : "/videos/vid1.mp4"
        },
        {
          "img" : "https://talksport.com/wp-content/uploads/sites/5/2023/06/LB-tsport-freddie-copy.jpg?strip=all&quality=100&w=1500&h=1000&crop=1",
          "url" : "/videos/vid1.mp4"
        }
    ]
  return (
    <div>
      <Navbar />
      <br />
      <div className="container row">
        {articles.map((element) => {
          return (
            <div className="col-md-12" key={element.url}>
              <Router>
        <Switch>
          <Route path="/video-page" component={Videopage} />
              <Content imageurl={element.img} movieurl={element.url} />
              </Switch>
      </Router>
            </div>
          );
        })}
      </div>
      {/* <Router>
        <Switch>
          <Route path="/video-page" component={Videopage} />
          <Content
            imageurl="https://talksport.com/wp-content/uploads/sites/5/2023/06/LB-tsport-freddie-copy.jpg?strip=all&quality=100&w=1500&h=1000&crop=1"
            movieurl="/videos/vid1.mp4"
          />
        </Switch>
      </Router> */}
    </div>
  );
}


